import React, { useState, useEffect } from 'react';
import { ForceGraph2D } from 'react-force-graph';
import axios from 'axios';

const BubbleStats = () => {
    const [graphData, setGraphData] = useState({ nodes: [], links: [] });
    const [selectedNode, setSelectedNode] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const fetchData = async () => {
        try {
            setLoading(true);
            setError(null);

            // Fetch active hosts
            const hostsResponse = await axios.get('http://192.168.1.148:3000/lua/rest/v2/get/active/hosts.lua', {
                auth: {
                    username: 'admin',
                    password: 'nN38vvDU'
                }
            });

            // Filter for 192.168.1.x IPs
            const localHosts = hostsResponse.data.rsp.filter(host =>
                host.ip && host.ip.startsWith('192.168.1.')
            );

            // Create nodes for each local host
            const nodes = localHosts.map(host => ({
                id: host.ip,
                name: host.name || host.ip,
                val: host.bytes || 1, // Use bytes for node size
                group: 1,
                details: {
                    mac: host.mac,
                    bytes: host.bytes,
                    packets: host.packets
                }
            }));

            // Create links between nodes (optional, can be customized)
            const links = nodes.map((node, index) => {
                if (index < nodes.length - 1) {
                    return {
                        source: node.id,
                        target: nodes[index + 1].id,
                        value: 1
                    };
                }
                return null;
            }).filter(Boolean);

            setGraphData({ nodes, links });
        } catch (err) {
            console.error('Error fetching data:', err);
            setError('Failed to fetch data. Please try again later.');
        } finally {
            setLoading(false);
        }
    };

    const fetchL7Stats = async (ip) => {
        try {
            const response = await axios.get(`http://192.168.1.148:3000/lua/rest/v2/get/host/l7/stats.lua?ifid=1&host=${ip}`, {
                auth: {
                    username: 'admin',
                    password: 'nN38vvDU'
                }
            });
            return response.data.rsp;
        } catch (err) {
            console.error('Error fetching L7 stats:', err);
            return null;
        }
    };

    useEffect(() => {
        fetchData();
        // Refresh data every 30 seconds
        const interval = setInterval(fetchData, 30000);
        return () => clearInterval(interval);
    }, []);

    const handleNodeClick = async (node) => {
        setSelectedNode(node);
        if (node) {
            const l7Stats = await fetchL7Stats(node.id);
            if (l7Stats) {
                setSelectedNode(prev => ({ ...prev, l7Stats }));
            }
        }
    };

    if (loading) return <div>Loading...</div>;
    if (error) return <div className="error">{error}</div>;

    return (
        <div className="bubble-stats">
            <div className="graph-container">
                <ForceGraph2D
                    graphData={graphData}
                    nodeLabel="name"
                    nodeColor={node => node.group === 1 ? '#ff6b6b' : '#4ecdc4'}
                    nodeRelSize={6}
                    linkWidth={1}
                    linkColor={() => '#999'}
                    onNodeClick={handleNodeClick}
                />
            </div>
            {selectedNode && (
                <div className="node-details">
                    <h3>{selectedNode.name}</h3>
                    <p>IP: {selectedNode.id}</p>
                    <p>MAC: {selectedNode.details.mac}</p>
                    <p>Total Bytes: {selectedNode.details.bytes}</p>
                    <p>Total Packets: {selectedNode.details.packets}</p>
                    {selectedNode.l7Stats && (
                        <div className="l7-stats">
                            <h4>Application Statistics:</h4>
                            {selectedNode.l7Stats.map((stat, index) => (
                                <div key={index}>
                                    <p>{stat.label}: {stat.value} bytes</p>
                                </div>
                            ))}
                        </div>
                    )}
                </div>
            )}
            <style jsx>{`
        .bubble-stats {
          display: flex;
          height: 100vh;
          background: #1a1a1a;
          color: #fff;
        }
        .graph-container {
          flex: 1;
          height: 100%;
        }
        .node-details {
          width: 300px;
          padding: 20px;
          background: #2a2a2a;
          border-left: 1px solid #333;
          overflow-y: auto;
        }
        .l7-stats {
          margin-top: 20px;
          padding-top: 20px;
          border-top: 1px solid #333;
        }
        .error {
          color: #ff6b6b;
          padding: 20px;
          text-align: center;
        }
      `}</style>
        </div>
    );
};

export default BubbleStats;
